/* eslint-disable @typescript-eslint/no-explicit-any */
import jsPDF from "jspdf";
import autoTable from "jspdf-autotable";
import { InvoiceData } from "../types/invoice";
import { formatNumber } from ".";

export const generateInvoicePDF = (invoiceData: InvoiceData, printType:string ) => {
  const doc = new jsPDF();
  doc.setFillColor(2255,235,235); // Tomato color or any RGB
doc.rect(155, 40, 40, 8, "F"); // x, y, width, height, "F" for filled rectangle
doc.setTextColor(0,0,0);
doc.setFontSize(10);
doc.text(`${invoiceData?.invoiceType}`, 170, 45, { align: "center" });
doc.setFillColor(2255,235,235);
doc.rect(142, 54, 54, 8, "F"); // x, y, width, height, "F" for filled rectangle
doc.setTextColor(0,0,0);
doc.setFontSize(10);
doc.text(`${printType}`, 170, 59, { align: "center" });

// Reset text color if needed later
doc.setTextColor(0, 0, 0);
  const logoBase64="data:image/png;base64,"
 const qr="data:image/png;base64,"
  let bankTableY = (doc as any).autoTable.previous.finalY + 0;
  doc.addImage(logoBase64, "PNG", 15, 8, 30, 30);
  // Header Section
  doc.setFontSize(10);
  doc.text("KULAJA PRAHANAME NAMAHA", 105, 10, { align: "center" });
  doc.setFontSize(16);
  doc.setFont("helvetica", "bold");
  doc.text("Abirami Enterprises", 105, 18, { align: "center" });
  doc.setFontSize(11);
  doc.text("Quality Motor & Pump Spares", 105, 24, { align: "center" });
  doc.setFontSize(9);
  doc.text("Address: 1052, Bharathiyar Road, P.N.Palayam, Coimbatore 641 037, Tamil Nadu, India", 105, 30, { align: "center" });
  doc.text("Contact: 0422-4258851 | Email ID: ce.abiramienterprises@gmail.com", 105, 34, { align: "center" });
  doc.setFontSize(10);
  doc.text("GST NO: 33ACVPC9001G1ZS", 15, 45);
 

 

  // Sender & Receiver Details Table
  autoTable(doc, {
    startY: 70,
    head: [[ "To"]],
    body: [ [
        `${invoiceData?.clientName}\n${invoiceData?.state}`,
      ],
    ],
    theme: "grid",
    styles: { fontSize: 10, cellPadding: 2 },
    headStyles: { fillColor: [255,235,235], textColor: 0, fontStyle: "bold" },
  });

  // Billing Details Table
  autoTable(doc, {
    startY: (doc as any).autoTable.previous.finalY + 0,
    head: [["Invoice ID", "Invoice Type", "Tax Type", "Created Date", "State & Code"]],
    body: [
      [
        invoiceData?.invoiceId,
        invoiceData?.invoiceType,
        invoiceData?.taxType,
        new Date(invoiceData?.date).toDateString(),
        `${invoiceData?.state} (${invoiceData?.code})`,
      ],
    ],
    theme: "grid",
    styles: { fontSize: 10, cellPadding: 2 },
    headStyles: { fillColor: [255,235,235], textColor: 0, fontStyle: "bold" },
  });

  // Items Table
  autoTable(doc, {
    startY:(doc as any).autoTable.previous.finalY + 0,
    head: [["S.No", "Description", "HSN No.", "Quantity", "Rate", "Discount", "Amount"]],
    body: invoiceData?.productDetails?.map((item, index) => [
      index + 1,
      item?.description,
      item?.HSNno,
      item?.quantity,
      item?.rate,
      item?.discount,
      item?.amount,
    ]),
    theme: "grid",
    styles: { fontSize: 10, cellPadding: 2 },
    headStyles: { fillColor: [255,235,235], textColor: 0, fontStyle: "bold" },
  });

  // Totals Table
  autoTable(doc, {
    startY: (doc as any).autoTable.previous.finalY + 0,
    head: [["Description", "Amount (INR)"]],
    body: [
      ["Sub Total", formatNumber(invoiceData?.subTotal ?? 0)],
      ["PF Amount", formatNumber(invoiceData?.pfAmount ?? 0)],
      [
        invoiceData?.taxType === "IGST" ? "IGST @ 18%" : "CGST @ 9% & SGST @ 9%",
        formatNumber(invoiceData?.taxGST ?? 0),
      ],
      ["Total", formatNumber(invoiceData?.totalAmount ?? 0)],
    ],
    theme: "grid",
    styles: { fontSize: 10, cellPadding: 2 },
    headStyles: { fillColor: [255,235,235], textColor: 0, fontStyle: "bold" },
  });
  const bankTableHeight = 60; // Adjust based on your QR size and cell padding
const pageHeight = doc.internal.pageSize.height;
const currentY = (doc as any).autoTable.previous.finalY + 10;

// If the bank table won't fit, add a new page
if (currentY + bankTableHeight > pageHeight) {
  doc.addPage();
  bankTableY = 20; // Reset Y position on new page
} else {
  bankTableY = currentY;
}
  autoTable(doc, {
    startY: bankTableY,
    head: [["Bank Details", "QR Code"]],
    body: [
      [
        "State Bank of India\nxxxx 98\nSBIN0098763\nAvinashi Road, Coimbatore-37",
        "" // Image goes here
      ],
    ],
    theme: "grid",
    styles: { fontSize: 10, cellPadding: 5, minCellHeight: 50 }, // Only applies to body
    headStyles: { 
      fillColor: [255, 235, 235], 
      textColor: 0, 
      fontStyle: "bold",
      minCellHeight: 10 // Reduce header height
    },
  
    didDrawCell: (data) => {
      if (data.section === 'body' && data.row.index === 0 && data.column.index === 1) {
        doc.addImage(qr, "PNG", data.cell.x + 5, data.cell.y + 5, 40, 40);
      }
    },
  });
  
  doc.setFontSize(9);
  doc.text("TERMS & CONDITIONS:", 15, (doc as any).lastAutoTable.finalY + 8);
  doc.text("1. Goods once sold will not be taken back under any circumstances.", 15, (doc as any).lastAutoTable.finalY + 14);
  doc.text("2. We are not responsible for any loss or damage of goods in transit.", 15, (doc as any).lastAutoTable.finalY + 18);


 

 

  // Save the PDF
  doc.save("invoice.pdf");
};